import DashboardIcon from "../../Images/side-bar-icons/dashboard.png";
import MRIcon from "../../Images/side-bar-icons/mr.png";
import OnboardIcon from "../../Images/side-bar-icons/onboard.png";
import PatientIcon from "../../Images/side-bar-icons/patient.png";
import Messanger from "../../Images/side-bar-icons/messanger.png";
import Logout from "../../Images/side-bar-icons/logout.png";





export const SideBarData = [
    {
        name:"Dashboard",
        icon:DashboardIcon
    },
    {
        name:"Onboarding",
        icon:OnboardIcon
    },
    {
        name:"MR Onboarding",
        icon:MRIcon
    },
    {
        name:"Lab Onboarding",
        icon:MRIcon
    },
    {
        name:"Patient Information",
        icon:PatientIcon
    },
    {
        name:"Messanger",
        icon:Messanger
    },
    {
        name:"Webvitals",
        icon:PatientIcon
    },

    {
        name:"Logout",
        icon:Logout
    }
]
